import React from 'react';
import * as d3 from 'd3';
import data from '../data/airtable.csv';
import RecentWorks from './RecentWorks';

const Projects = () => {
	var works = [];
	d3.csv(data, async function(data) { await works.push(data)});
	console.log(works);
	return(
		<div style={{ marginTop: '2em', marginBottom: '2em' }}>
			<div style={{marginBottom: '1em', textAlign: 'center'}}>Projects</div>
			<div className="ui three column grid">
				<div className="column">
					<RecentWorks work={works[0]} />
				</div>
				<div className="column">
					<RecentWorks work={works[1]} />
				</div>
				<div className="column">
					<RecentWorks work={works[2]} />
				</div>
			</div>
		</div>
	);
}

export default Projects;
